script: |
  super -f text -I q6460.spq | sort > q6460.out

inputs:
  - name: q6460.spq
    data: |
      SELECT DISTINCT + 7 * - ( COUNT ( * ) ) col1 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1 WHERE NOT + ( 60 ) IS NULL;
  - name: tab1

outputs:
  - name: q6460.out
    data: |
      -63
